2620923c-3dae-4b4a-9034-e408a10bac14=ReadMe\r\n\=\=\=\=\=\=\=\r\n\r\nHow to configure\r\n----------------------------------------\r\n\r\nDo not modify this module, instead\:\r\n1. Create a new module called 'MxModelReflectionCustomizations'.\r\n2. Add new pages to this module, reuse snippets from the 'MxModelReflection' module. \r\n    The pages in the 'MxModelReflectionModule' can be used as examples.\r\n3. Create new microflows to replace the microflows which open forms. Generic microflows can be reused.
