c621df80-cfbb-44fb-8489-83054dc5184a=Readme\r\n\=\=\=\=\=\=\=\=\=\=\=\=\=\=\r\n\r\nConfiguration\r\n-------------------------------------\r\nDo not modify this module, instead\r\n1. Connect the \u201cQueueOverview\u201d form to your application. This is the starting place for defining the different queues and processes. \r\n2. Add the microflow "ASu_InitialiseQueue" as a startup event to instantiate the queue. \r\n3. Off course you\u2019ll want to retrieve the object for which you\u2019ve created an queuedAction, the best way to do this is create an association from your object to the QueuedAction entity. This can either be a reference(set) with the default owner or the owner both, but try to prevent to add an association from QueuedAction to your entity.\r\n4. In the microflow you\u2019ve configured in the queue there should be an QueuedAction input parameter, using this parameter you can retrieve your object.\r\n\r\nIn the folder\: \u201cExample / Test\u201d you will found an example how to queue an action.
